import React from "react";
import SquareComponent from "./SquareComponent";

function BoardComponent() {
  const squares = [];
  for (let i = 0; i < 64; i++) {
    squares.push(<SquareComponent />, { number: i });
  }
  return (
    <div
      style={{
        width: "800px",
        height: "800px",
        display: "flex",
        flexWrap: "wrap",
      }}
    >
      <div>
        {squares.map((square) => (
          // assign react key

          <span key={square.number}></span>
        ))}
      </div>
      {squares}
    </div>
  );
}
export default BoardComponent;
